import "./CommentList.module.scss";
import React, { Fragment } from "react";
import Comment from "../Comment/Comment";

const CommentList = ({ discussionListData }) => {
	console.log(discussionListData);
	return (
		<Fragment>
			<Comment />
		</Fragment>
	);
};

export default CommentList;
